import React, { useEffect, useState } from 'react';
import api from '../api/axiosConfig';
import JobCard from '../components/JobCard';

const styles = {
  container: {
    maxWidth: 900,
    margin: '20px auto',
    padding: 16,
    fontFamily: "'Segoe UI', Tahoma, Geneva, Verdana, sans-serif",
    backgroundColor: '#f9fafb',
    borderRadius: 8,
    boxShadow: '0 2px 8px rgba(0,0,0,0.1)',
  },
  card: {
    background: 'white',
    borderRadius: 8,
    boxShadow: '0 2px 6px rgba(0,0,0,0.1)',
    padding: 20,
    marginBottom: 20,
  },
  h2: {
    marginBottom: 16,
    color: '#222',
  },
  input: {
    padding: '10px 12px',
    border: '1.8px solid #ccc',
    borderRadius: 6,
    fontSize: '1rem',
    flex: 1,
    minWidth: 120,
  },
  btn: {
    backgroundColor: '#007bff',
    border: 'none',
    borderRadius: 5,
    padding: '8px 14px',
    color: 'white',
    fontWeight: 600,
    cursor: 'pointer',
  },
  row: {
    display: 'flex',
    gap: 10,
    flexWrap: 'wrap',
    marginBottom: 12,
  },
  small: {
    fontSize: '0.85rem',
    color: '#666',
  },
  btnDisabled: {
    backgroundColor: '#a3a9b8',
    cursor: 'not-allowed',
  },
};

export default function JobList({ user }) {
  const [jobs, setJobs] = useState([]);
  const [appliedJobs, setAppliedJobs] = useState([]);
  const [filter, setFilter] = useState({ title: '', location: '', skill: '' });

  async function fetchJobs() {
    try {
      const params = {};
      if (filter.title) params.title = filter.title;
      if (filter.location) params.location = filter.location;
      if (filter.skill) params.skill = filter.skill;
      const res = await api.get('/jobs/filter', { params });
      setJobs(res.data);
    } catch (err) {
      console.error(err);
    }
  }

  async function fetchAppliedJobs() {
    if (!user || user.role !== 'JOBSEEKER') return;
    try {
      const res = await api.get('/profile/me', { withCredentials: true });
      setAppliedJobs(res.data.appliedJobIds || []);
    } catch (err) {
      console.error(err);
    }
  }

  useEffect(() => {
    fetchJobs();
    fetchAppliedJobs();
  }, []);

  async function handleApply(jobId) {
    try {
      await api.post(`/jobs/apply/${jobId}`, {}, { withCredentials: true });
      setAppliedJobs([...appliedJobs, jobId]);
      alert('Applied successfully!');
    } catch (err) {
      alert('Apply failed');
    }
  }

  if (!user || user.role !== 'JOBSEEKER') {
    return <div>You must be logged in as a Job Seeker to view jobs here.</div>;
  }

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h2 style={styles.h2}>Available Jobs</h2>
        <div style={styles.row}>
          <input
            style={styles.input}
            placeholder="Search title"
            value={filter.title}
            onChange={(e) => setFilter({ ...filter, title: e.target.value })}
          />
          <input
            style={styles.input}
            placeholder="Location"
            value={filter.location}
            onChange={(e) => setFilter({ ...filter, location: e.target.value })}
          />
          <input
            style={styles.input}
            placeholder="Skill"
            value={filter.skill}
            onChange={(e) => setFilter({ ...filter, skill: e.target.value })}
          />
          <button style={styles.btn} onClick={fetchJobs}>
            Search
          </button>
        </div>

        {jobs.length === 0 && <div style={styles.small}>No jobs found.</div>}
        {jobs.map((job) => (
          <div key={job.id} style={{ marginBottom: 16 }}>
            <JobCard job={job} showDelete={false} />
            <button
              style={{
                ...styles.btn,
                marginTop: 8,
                ...(appliedJobs.includes(job.id) ? styles.btnDisabled : {}),
              }}
              disabled={appliedJobs.includes(job.id)}
              onClick={() => handleApply(job.id)}
            >
              {appliedJobs.includes(job.id) ? 'Applied' : 'Apply'}
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}
